import React, {useState} from "react"
import styled from "styled-components"

const Delete_popup_container = styled.div`
    position: relative;
    display: ${props => props.activate ? 'block' : 'none'};
`

const Delete_popup = (props) => {
    // console.log(props)

    return <React.Fragment>

    <Delete_popup_container
        activate={props.activate}
        onClick={(e) => {
            const reviewElement = e.target.parentElement.previousElementSibling;
            if (reviewElement) {
                reviewElement.classList.add('selected-for-delete');
                console.log('리뷰가 삭제 대상으로 선택되었습니다');
            }
        }}
    >
        <span>Are you sure you want to delete this review?</span>
    </Delete_popup_container>

    </React.Fragment>

}

export default Delete_popup
